import React from "react"
import { Box} from "@chakra-ui/react";
import "../Css/Nav.css"
import logo from "../asset/logo.png"
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Main"


const navlinks = [
    {
        name: <Home/>,
        link: "/home",
    },
    {
        name: "About",
        link: "/about",
    },
    {
        name:"Menu",
        link:"/menu",
    },
    {
        name:"Reservations",
        link:"/reservations",
    },
    {
        name:"order",
        link:"/order",
    },

    {
        name: "Login",
        link: "/login",
    },

];

const image =[
    {
        source: "./Assets/images/Logo.png",
        name:  "Log",
    }
];

const Nav = () =>{
return (
    <nav>
        <Box maxW = "sm" maxH = "sm">
        <div class = "flex-container" >
        <img src= {logo} alt = "Logo" />
        <Routes>
        {navlinks.map((navlink, index) => (
            <Route
            path={navlink.link} element={navlink.name}> {navlink.name}
            </Route>
        ))}
        </Routes>
        </div>
        </Box>
    </nav>
);

};
export default Nav;
